import React from 'react';
import { Swappable } from '@shopify/draggable';
export default function Cube (props) {
  React.useEffect(() => {
    const swappable = new Swappable(document.querySelectorAll('div'), {
      draggable: '.cube-three-side',
      classes: {
        'draggable:over': ['draggable--over', 'bg-red-200', 'bg-opacity-25'],
      },
    });
  
    swappable.on('swappable:start', () => console.log('swappable:start'));
    swappable.on('swappable:swapped', () => console.log('swappable:swapped'));
    swappable.on('swappable:stop', () => console.log('swappable:stop')); 
    return () => {
      swappable.destroy();
    }
  }, []);
  return (
    <div className='cube-three-side' style={{ height: '235px', width: '222px', position: 'relative', margin: '11px 0 0 0', float: 'left'}}>
      <div className='face face-front neonText'
        style={{
          position: 'absolute',
          left: '0%',
          top: '25%',
          height: '100px',
          width: '104.3px',
          fontSize: '70px',
          fontWeight: 'bold',
          textAlign: 'center',
          border:'3.5px solid rgba(253, 143, 255, 0.48)',
          borderRadius: '4px 2px 2px 2px',
          transformStyle: 'preserve-3d',
          backgroundColor: props.frontColor,
          transform: 'skew(0deg, 30deg)'
        }}
      >{props.front}
      </div>
      <div className='face face-side neonText'
        style={{
          position: 'absolute',
          left: '50%',
          top: '25%',
          height: '100px',
          width: '104.3px',
          fontSize: '70px',
          fontWeight: 'bold',
          textAlign: 'center',
          border:'3.5px solid rgba(253, 143, 255, 0.48)',
          borderRadius: '2px 4px 2px 2px',
          backgroundColor: props.sideColor,
          transformStyle: 'preserve-3d',
          transform: 'skew(0deg, -30deg)'
        }}
      >{props.side}
      </div>
      <div className='face face-top neonText'
        style={{
          position: 'absolute',
          left: '14%',
          top: '-22%',
          height: '156px',
          width: '153px',
          fontSize: '90px',
          fontWeight: 'bold',
          textAlign: 'center',
          border:'3.5px solid rgba(253, 143, 255, 0.48)',
          borderRadius: '2px 5px 2px 5px',
          transformStyle: 'preserve-3d',
          backgroundColor: props.topColor,
          transform: 'rotateX(55deg) rotateZ(45deg)'
        }}
      >{props.top}
      </div>
    </div>
  );
}
